using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading;
using System.Threading.Tasks;

namespace Opdex.Platform.WebApi.Controllers;

[ApiController]
[Route("deploy")]
public class DeployController : ControllerBase
{
    private readonly IMediator _mediator;
    private readonly ILogger<DeployController> _logger;
    private readonly NetworkType _network;

    public DeployController(IMediator mediator, ILogger<DeployController> logger, OpdexConfiguration opdexConfiguration)
    {
        _mediator = mediator ?? throw new ArgumentNullException(nameof(mediator));
        _logger = logger ?? throw new ArgumentNullException(nameof(logger));
        _network = opdexConfiguration?.Network ?? throw new ArgumentNullException(nameof(opdexConfiguration));
    }


    /// <summary>Deploy Devnet</summary>
    /// <remarks>
    /// Long running (5 minutes) deployment of local environment opdex smart contracts.
    /// </remarks>
    /// <param name="request">The wallet parameters needed for local env smart contract transactions.</param>
    /// <param name="cancellationToken">cancellation token.</param>
    [HttpPost("dev-contracts")]
    [Authorize(Policy = "AdminOnly")]
    [Network(NetworkType.DEVNET)]
    public async Task<IActionResult> DeployDevModeEnvironment(LocalWalletCredentials request, CancellationToken cancellationToken)
    {
        var markets = await _mediator.Send(new RetrieveAllMarketsQuery(), cancellationToken);
        if (markets.Any())
        {
            throw new Exception("Markets already exist");
        }

        var locked = await _mediator.Send(new MakeIndexerLockCommand(IndexLockReason.Deploying), CancellationToken.None);
        if (!locked) throw new IndexingAlreadyRunningException();

        // Deploy governance token
        var createGovernanceTokenParams = new[]
        {
            new SmartContractMethodParameter("Governance Token"),
            new SmartContractMethodParameter("GOV"),
            SmartContractMethodParameter.Deserialize(_vaultDistributionSchedule),
            SmartContractMethodParameter.Deserialize(_minerDistributionSchedule),
            // new SmartContractMethodParameter((ulong)675) // 3 realtime hours in blocks per "year"
            // new SmartContractMethodParameter((ulong)1350) // 6 realtime hours in blocks per "year" - 30 minute mining period
            // new SmartContractMethodParameter((ulong)2700) // 12 realtime hours in blocks per "year" - 1 hour mining period
            // new SmartContractMethodParameter((ulong)5400) // 24 realtime hours in blocks per "year" - 2 hour mining period
            // new SmartContractMethodParameter((ulong)32400) // 6 realtime days in blocks per "year" - 12 hour mining period
            new SmartContractMethodParameter((ulong)64800) // 12 realtime days in blocks per "year - 1 day mining period
            // new SmartContractMethodParameter((ulong)75600) // 14 realtime days in blocks per "year" - 1.x day mining period
        };
        var createGovernanceTokenRequest = new SmartContractCreateRequestDto(governanceByteCode, request.WalletAddress, createGovernanceTokenParams,
                                                                             request.WalletName, request.WalletPassword);

        var governanceTokenTransaction = await CallAndWait(
            async () => await _mediator.Send(new CallCirrusCreateSmartContractCommand(createGovernanceTokenRequest), cancellationToken));

        // Process governance token deployment
        await _mediator.Send(new ProcessGovernanceDeploymentTransactionCommand(governanceTokenTransaction.Hash), CancellationToken.None);

        // Deploy Market Deployer
        var createDeployerRequest = new SmartContractCreateRequestDto(marketDeployerByteCode, request.WalletAddress, request.WalletName, request.WalletPassword);

        var deployerTransaction = await CallAndWait(
            async () => await _mediator.Send(new CallCirrusCreateSmartContractCommand(createDeployerRequest), cancellationToken));

        var createStakingMarketParams = new[] { new SmartContractMethodParameter(governanceTokenTransaction.NewContractAddress) };
        var createStakingMarketRequest = new SmartContractCallRequestDto(deployerTransaction.NewContractAddress, request.WalletName,
                                                                         request.WalletAddress, request.WalletPassword, FixedDecimal.Zero,
                                                                         "CreateStakingMarket", createStakingMarketParams);

        var createStakingMarketTransaction = await CallAndWait(
            async () => await _mediator.Send(new CallCirrusCallSmartContractMethodCommand(callDto: createStakingMarketRequest), cancellationToken));

        // Process Deployer deployment
        await _mediator.Send(new ProcessCoreDeploymentTransactionCommand(deployerTransaction.Hash), CancellationToken.None);

        var stakingMarket = (CreateMarketLog)createStakingMarketTransaction.Logs.First();
        var createLiquidityPoolTransactions = new List<Transaction>();

        // Create 4 Tokens
        foreach (var tokenParams in _createSrcTokensParams)
        {
            // Create Tokens
            var createTokenRequest = new SmartContractCreateRequestDto(srcByteCode, request.WalletAddress, tokenParams.CreateParams,
                                                                       request.WalletName, request.WalletPassword);
            var createTokenTransaction = await CallAndWait(
                async () => await _mediator.Send(new CallCirrusCreateSmartContractCommand(createTokenRequest), cancellationToken));

            // Approve router allowance for the full owner amount
            var approveAllowanceParams = new[]
            {
                new SmartContractMethodParameter(stakingMarket.Router), new SmartContractMethodParameter(UInt256.Zero), tokenParams.CreateParams[0]
            };
            var approveAllowanceRequest = new SmartContractCallRequestDto(createTokenTransaction.NewContractAddress, request.WalletName,
                                                                          request.WalletAddress, request.WalletPassword, FixedDecimal.Zero, "Approve",
                                                                          approveAllowanceParams);

            await CallAndWait(async () => await _mediator.Send(new CallCirrusCallSmartContractMethodCommand(callDto: approveAllowanceRequest), cancellationToken));

            // Create SRC liquidity pools
            var createLiquidityPoolParams = new[] { new SmartContractMethodParameter(createTokenTransaction.NewContractAddress) };
            var createLiquidityPoolRequest = new SmartContractCallRequestDto(stakingMarket.Market, request.WalletName, request.WalletAddress,
                                                                             request.WalletPassword, FixedDecimal.Zero, "CreatePool",
                                                                             createLiquidityPoolParams);
            var createLiquidityPoolTransaction = await CallAndWait(
                async () => await _mediator.Send(new CallCirrusCallSmartContractMethodCommand(callDto: createLiquidityPoolRequest), cancellationToken));

            createLiquidityPoolTransactions.Add(createLiquidityPoolTransaction);
        }

        // Get liquidity pools to use for initial governance token distribution and mining governance nominations
        var poolAddresses = createLiquidityPoolTransactions
            .Select(t => ((CreateLiquidityPoolLog)t.Logs.First(log => log.LogType == TransactionLogType.CreateLiquidityPoolLog)).Pool);

        var poolsParams = poolAddresses.Select(address => new SmartContractMethodParameter(address)).ToArray();
        var distributeGovernanceTokenRequest = new SmartContractCallRequestDto(governanceTokenTransaction.NewContractAddress, request.WalletName, request.WalletAddress,
                                                                               request.WalletPassword, FixedDecimal.Zero, "DistributeGenesis", poolsParams);

        await CallAndWait(async () => await _mediator.Send(new CallCirrusCallSmartContractMethodCommand(callDto: distributeGovernanceTokenRequest), cancellationToken));

        // Create Governance Token's Liquidity Pool
        // Note: we can create the pool but to obtain tokens, the vault vesting period must clear or the governance token must be mined
        var createGovernanceTokenPoolParams = new[] { new SmartContractMethodParameter(governanceTokenTransaction.NewContractAddress) };
        var createGovernanceTokenPoolRequest = new SmartContractCallRequestDto(stakingMarket.Market, request.WalletName, request.WalletAddress,
                                                                               request.WalletPassword, FixedDecimal.Zero, "CreatePool", createGovernanceTokenPoolParams);

        await CallAndWait(async () => await _mediator.Send(new CallCirrusCallSmartContractMethodCommand(callDto: createGovernanceTokenPoolRequest), cancellationToken));

        var bestBlock = await _mediator.Send(new GetBestBlockReceiptQuery(), cancellationToken);
        await _mediator.Send(new ProcessLatestBlocksCommand(bestBlock, _network), CancellationToken.None);

        await _mediator.Send(new MakeIndexerUnlockCommand());

        return NoContent();
    }

    private async Task<Transaction> CallAndWait(Func<Task<Sha256>> call)
    {
        const int maxRetries = 5;
        const int backoff = 5;
        var attempt = 0;

        Sha256 txHash = default;
        Transaction transaction = null;

        try
        {
            txHash = await call();
        }
        catch (Exception ex)
        {
            _logger.LogError(ex, "Failed to submit transaction.");
        }

        while (++attempt <= maxRetries)
        {
            try
            {
                if (attempt > 1)
                {
                    await Task.Delay(TimeSpan.FromSeconds(backoff));
                }

                transaction = await _mediator.Send(new RetrieveCirrusTransactionByHashQuery(txHash));

                if (transaction == null)
                {
                    continue;
                }

                _logger.LogInformation($"Created and received transaction {txHash}.");

                break;
            }
            catch (Exception ex)
            {
                _logger.LogInformation(ex, $"Failed to find transaction {txHash}.");
            }
        }

        return transaction;
    }

    private const string marketDeployerByteCode = "";

    private const string governanceByteCode = "";

    private const string srcByteCode = "";
    private const string _vaultDistributionSchedule = "10#";
    private const string _minerDistributionSchedule = "10#";

    private readonly TokenDetails[] _createSrcTokensParams =
    {
        new TokenDetails
        {
            CreateParams = new[]
            {
                new SmartContractMethodParameter((UInt256)2100000000000000), // 21 Million
                new SmartContractMethodParameter("BTC (Wrapped)"),
                new SmartContractMethodParameter("xBTC"),
                new SmartContractMethodParameter((byte)8)
            }
        },
        new TokenDetails
        {
            CreateParams = new[]
            {
                new SmartContractMethodParameter(UInt256.Parse("100000000000000000000000000")), // 100 Million
                new SmartContractMethodParameter("ETH (Wrapped)"),
                new SmartContractMethodParameter("xETH"),
                new SmartContractMethodParameter((byte)18)
            }
        },
        new TokenDetails
        {
            CreateParams = new[]
            {
                new SmartContractMethodParameter(UInt256.Parse("1000000000000000000000000000")), // 1 Billion
                new SmartContractMethodParameter("BNB (Wrapped)"),
                new SmartContractMethodParameter("xBNB"),
                new SmartContractMethodParameter((byte)18)
            }
        },
        new TokenDetails
        {
            CreateParams = new[]
            {
                new SmartContractMethodParameter((UInt256)500000000000000000), // 5 Billion
                new SmartContractMethodParameter("Gluon"),
                new SmartContractMethodParameter("GLU"),
                new SmartContractMethodParameter((byte)8)
            }
        }
    };

    private class TokenDetails
    {
        public SmartContractMethodParameter[] CreateParams;
    }
}
